import React from 'react';
import { useNavigate } from 'react-router-dom';
import './NursePage.css';  // Import CSS for styling

const NursePage = () => {
  const navigate = useNavigate();  // Use the navigate function from react-router-dom

  const handleNavigation = (path) => {
    navigate(path);  // Navigate to the specific form route
  };

  return (
    <div className="nurse-page">
      <h1>Nurse Portal</h1>
      <p>Select the appropriate form to fill in patient details:</p>
      <div className="form-options">
        <button onClick={() => handleNavigation('/surveillance-form')}>
          Patient Administration Details
        </button>
        <button onClick={() => handleNavigation('/surgery-form')}>
          Patient Surgery Details
        </button>
        <button onClick={() => handleNavigation('/antibiotic-form')}>
          Patient Antibiotic Details
        </button>
        <button onClick={() => handleNavigation('/microbiology-form')}>
          Patient Microbiology Details
        </button>
        <button onClick={() => handleNavigation('/event-details-form')}>
          Patient Event Details
        </button>
        <button onClick={() => handleNavigation('/ssi-evaluation-form')}>
          SSI Evaluation Form
        </button>
      </div>
    </div>
  );
};

export default NursePage;
